import React, { useState } from "react";
import { RowNewsletter } from "./RowNewsletter";

export const TableNeswsletter = () => {
   const [neswsletterList, setNeswsletterList] = useState ([
    {
        "newsletterId": 5,
        "newsletterTypeId": 1,
        "newsletterName": "BigBang",
        "newsletterDescription": "It's about your art, not about you.",
        "newsletterAttach": "artToday.png",
        "sentDate": "2022-10-29T19:14:03.477155",
        "sentEstatus": 1,
        "creationDate": "2022-10-29T18:22:09.054873"
    }    ,
    {
        "newsletterId": 6,
        "newsletterTypeId": 2,
        "newsletterName": "Motivational Sports",
        "newsletterDescription": "If you love the game, you know it takes true dedication.",
        "newsletterAttach": "sportMessages.png",
        "sentDate": null,
        "sentEstatus": 0,
        "creationDate": "2022-10-29T22:58:26.893728"
    }
   ]);
  return (
    <>
      <table className="table table-striped">
        <thead>
          <tr>
            <th>Actions</th>
            <th>Name</th>
            <th>Attach</th>
            <th>Creation Date</th>
            <th>Sent Date</th>
            <th>Estatus</th>
          </tr>
        </thead>
        <tbody>
            {
                neswsletterList.map( neswsletter =>
                    (
                        <RowNewsletter neswsletter = { neswsletter } key={neswsletter.newsletterId}/>
                    ))
            }        
        </tbody>
      </table>
      <Modal title="Newsletter List- Email configuration" id="mailConfig" />
    </>
  );
};
